import styled from "styled-components";
import GitHubIcon from '@material-ui/icons/GitHub';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import MailOutlineIcon from '@material-ui/icons/MailOutline';

const Container = styled.div`
    display: flex
    justify-items: end;

    > hr {
        margin: -10px 30px -10px 0;
        border: 0.5px solid gray;      
    }
`

const SidebarOption = styled.div`
    margin: 25px 0px 25px 80px;
`

const ShortcutIcons = styled.div`
    margin-top: 40px;
    margin-left: 40px;

    .MuiSvgIcon-root {
        font-size: 25px;
        margin-left: 5px;
        margin-right: 5px;
    }
`

const Sidebar = () => (
    <Container>
        <SidebarOption>
            <h2>About</h2>
        </SidebarOption>

        <hr />

        <SidebarOption>
            <h2>Projects</h2>
        </SidebarOption>

        <SidebarOption>
            <h2>Post</h2>
        </SidebarOption>

        <SidebarOption>
            <h2>Tech News</h2>
        </SidebarOption>

        <ShortcutIcons>
          <GitHubIcon />
          <LinkedInIcon />
          <MailOutlineIcon />
        </ShortcutIcons>
    </Container>
)


export default Sidebar;
